import React from 'react';
import FetchData from "./FetchData";

function Teams() {
    const res = FetchData.useFetch("https://dog.ceo/api/breeds/image/random", {});
    if (!res.response) {
      return <div>Loading...</div>
    }
    return (
      <h3>
        Hii
      </h3>
    );
  }

export default FetchData
